- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CSchedule D, line 9, listed a debt
    owed to the committee from Early for Congress for voter lists.  The Early for
    Congress Committee is no longer in existence and the committee has forgiven that
    debt based on that fact according to CFR 116.9.  The committee also listed on
    schedule D, line 10, debts owed to MTA and to Special Event Rentals.  The committee
    believes that these two debts were listed in error and have sent letters to the
    respective vendors to confirm that no debts exist and none have been forgiven.
    \ The committee expects to report back by the next scheduled filing period, the
    year-end report due January 31, 2008, on the status of these inquiries.\n"
